import React, { Component } from 'react';
import axios from 'axios';

import cover from './coverp.png';
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends Component {

  state = {
    image: null,
    image2: null,
    processedImageData: null,
    processedImageData2: null,
  };



  handleImageChange = (e) => {
    this.setState({
      image: e.target.files[0],
      image2: e.target.files[0]
    });
  };

  handleSubmit = (e) => {
    e.preventDefault();

    if (this.state.image) {
      let form_data = new FormData();
      form_data.append('image', this.state.image, this.state.image.name);

      axios.post('http://localhost:8000/resnet50_unet/', form_data, {
        headers: {
          'content-type': 'multipart/form-data',
        },
        responseType: 'arraybuffer', // Request binary data
      })
        .then((res) => {
          // Convert the binary data to a base64 string
          const base64Data = btoa(
            new Uint8Array(res.data).reduce(
              (data, byte) => data + String.fromCharCode(byte),
              ''
            )
          );
          const processedImageData = `data:image/png;base64,${base64Data}`;
          this.setState({ processedImageData });
        })
        .catch((err) => console.log(err));
    } else {
      console.log('No image selected');
    }

    let form_data = new FormData();
    form_data.append('image', this.state.image, this.state.image.name);
      axios.post('http://localhost:8000/vgg16_unet/', form_data, {
        headers: {
          'content-type': 'multipart/form-data',
        },
        responseType: 'arraybuffer', // Request binary data
      })
        .then((res) => {
          // Convert the binary data to a base64 string
          const base64Data = btoa(
            new Uint8Array(res.data).reduce(
              (data, byte) => data + String.fromCharCode(byte),
              ''
            )
          );
          const processedImageData2 = `data:image/png;base64,${base64Data}`;
          this.setState({ processedImageData2});
        })
        .catch((err) => console.log(err));
  };

  render() {
    return (
      <div className="App">
        <div class="bg-dark bg-gradient 
                    w-100% h-100% p-3 text-light"> 
            <h1><center><b>Breast Cancer Segmentation Models</b></center></h1>
        </div> 

        <div class="media">
        <img src={cover} class="img-thumbnail" alt="20% height image" style={{width: "100%", height: "10%;"}}/>

        <div class="card text-left">
        <div class="card" style={{width: "10px;"}}>


</div>


  <div class="card-header"><center><b>Breast Cancer Awareness</b></center>

  </div>
  <div class="card-body">

    <p class="card-text">The objective of the model is to segment the tumors in breast cancer slide images. With the result of the model, we can notice the tumors more easily. To achieve this objective, we utilized cancer images and segmentation label from HistomicsUI (kitware.com) in which  the dataset associated with the paper: Amgad M, Elfandy H, ..., Gutman DA, Cooper LAD. Structured crowdsourcing enables convolutional segmentation of histology images. Bioinformatics. 2019. doi: 10.1093/bioinformatics/btz083
</p>

  </div>

</div>
  <div class="media-body">
    <h5 class="mt-0"></h5>
    <p>The objective of the model is to segment the tumors in breast cancer slide images. With the result of the model, we can notice the tumors more easily.</p>
    <p class="mb-0">To achieve this objective, we utilized cancer images and segmentation label from HistomicsUI (kitware.com) in which  the dataset associated with the paper: Amgad M, Elfandy H, ..., Gutman DA, Cooper LAD. Structured crowdsourcing enables convolutional segmentation of histology images. Bioinformatics. 2019. doi: 10.1093/bioinformatics/btz083.</p>
  </div>
</div>

<div id="list-example" class="list-group">
  <a class="list-group-item list-group-item-action" href="#list-item-1"><center><b>ResNet50 + Unet</b></center></a><p>สวัสดีค้าาา หนูชื่อทิดาพรชาวคูเวียง
  กกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกกก
  </p><p>ddddddddddddddsgสวัสค้าาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาาา</p>
  <a class="list-group-item list-group-item-action" href="#list-item-2"><center><b>VGG16 + Unet</b></center></a>

</div>
<div data-bs-spy="scroll" data-bs-target="#list-example" data-bs-offset="0" class="scrollspy-example" tabindex="0">
  <h4 id="list-item-1">Item 1</h4>
  <p>...</p>
  <h4 id="list-item-2">Item 2</h4>

</div>


        <form onSubmit={this.handleSubmit}>
          <p>
            <input
              type="file"
              id="image"
              accept="image/png, image/jpeg"
              onChange={this.handleImageChange}
              required
            />
          </p>
          <input type="submit" value="Upload Image" />
        </form>
        {this.state.processedImageData2 && (
          <img src={this.state.processedImageData2} alt="Processed Image" />

        )}





      </div>
    );
  }
}

export default App;
